shaders.vertex:
attribute vec4 aVertex;
attribute vec4 aTexCoord;
varying vec4 vTexCoord;

void main(void)
{
    vTexCoord.x = aTexCoord.x;
    vTexCoord.y = 1.0 - aTexCoord.y;
    gl_Position = aVertex;
}

shaders.fragment:
varying vec4 vTexCoord;
uniform sampler2D uTexture;
uniform float uT;
uniform vec2 uResolution;
uniform vec2 uMouse;

vec2 d = vec2(1.0, 1.0) / uResolution;
vec4 dead_color = vec4(0.0);
vec4 alive_color = vec4(1.0);

int is_alive(vec2 coord) {
  if (any(lessThan(texture2D(uTexture, coord), vec4(0.5))))
    return 1;
  return 0;
}

int count_neighbors(vec2 coord)
{
  int sum = 0;
  sum += is_alive(coord + vec2( d.x,  d.y));
  sum += is_alive(coord + vec2(-d.x,  d.y));
  sum += is_alive(coord + vec2(-d.x, -d.y));
  sum += is_alive(coord + vec2( d.x, -d.y));
  sum += is_alive(coord + vec2( 0.0,  d.y));
  sum += is_alive(coord + vec2( 0.0, -d.y));
  sum += is_alive(coord + vec2( d.x,  0.0));
  sum += is_alive(coord + vec2(-d.x,  0.0));
  return sum;
}

void main(void)
{
    int neighbors = count_neighbors(vTexCoord.st);
    vec4 color;
    if (is_alive(vTexCoord.st) == 1) {
      if (neighbors < 2) {
        color = dead_color;
      }
      else if (neighbors > 3) {
        color = dead_color;
      }
      else {
        color = alive_color;
      }
    }
    else
    {
      if (neighbors == 3) {
        color = alive_color;
      }
      else {
        color = dead_color;
      }
    }
    gl_FragColor = color;
}
